import { Component } from '@angular/core';

interface Comment {
  author: string;
  content: string;
}

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class ComentariosProdutosComponent {
  comments: Comment[] = [
    {
      author: 'João',
      content: 'Ótimo post! Obrigado por compartilhar.'
    },
    {
      author: 'Maria',
      content: 'Gostei muito desse conteúdo. Parabéns!'
    },
    {
      author: 'Pedro',
      content: 'Excelente explicação. Continue assim!'
    }
  ];
}
